package com.huotu.android.library.libpay.alipayV2;import java.util.Map;import android.text.TextUtils;import com.huotu.android.library.libpay.alipay.AliOrderInfo;public class AliPayResultV2 {	private String resultStatus;	private String result;	private String memo;	private AliOrderInfo aliOrderInfo;	public AliPayResultV2(Map<String, String> rawResult , AliOrderInfo orderInfo) {		this.aliOrderInfo = orderInfo;		if (rawResult == null) {			return;		}		for (String key : rawResult.keySet()) {			if (TextUtils.equals(key, "resultStatus")) {				resultStatus = rawResult.get(key);			} else if (TextUtils.equals(key, "result")) {				result = rawResult.get(key);			} else if (TextUtils.equals(key, "memo")) {				memo = rawResult.get(key);			}		}	}	@Override	public String toString() {		return "resultStatus={" + resultStatus + "};memo={" + memo				+ "};result={" + result + "}";	}	/**	 * @return the resultStatus	 */	public String getResultStatus() {		return resultStatus;	}	/**	 * @return the memo	 */	public String getMemo() {		return memo;	}	/**	 * @return the result	 */	public String getResult() {		return result;	}	public AliOrderInfo getAliOrderInfo() {		return aliOrderInfo;	}}